Here's an example of how you might write the `onSubmit` function for a form using React and Apollo Client for GraphQL:
```jsx
import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

const MyForm = () => {
  const [formState, setFormState] = useState({
    name: '',
    email: '',
    password: '',
  });

  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    try {
      const { data } = await addData({ variables: { ...formState } });
      console.log('Data added successfully:', data);
      // Handle successful data submission here
    } catch (error) {
      console.error('Error adding data:', error);
      // Handle error here
    }
  };

  const onChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value,
    });
  };

  return (
    <form onSubmit={onSubmit}>
      <input
        type="text"
        name="name"
        value={formState.name}
        onChange={onChange}
        placeholder="Name"
      />
      <input
        type="email"
        name="email"
        value={formState.email}
        onChange={onChange}
        placeholder="Email"
      />
      <input
        type="password"
        name="password"
        value={formState.password}
        onChange={onChange}
        placeholder="Password"
      />
      <button type="submit">Submit</button>
    </form>
  );
};

export default MyForm;
```
In this example, we're using the `useMutation` hook from Apollo Client to execute a GraphQL mutation. The `ADD_DATA` mutation is imported from a separate file, which should contain the GraphQL query for adding data.

The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, then calls the `addData` function with the form state as variables. The `await` keyword is used to wait for the mutation to complete before logging the result or handling any errors.

