Creating a Chrome extension involves several steps and requires knowledge of HTML, CSS, and JavaScript. Here's a basic outline of how you can create a Chrome extension that takes screenshots of a webpage:

1. Create a new folder on your computer to store the extension files.

2. Inside the folder, create a new file named `manifest.json`. This file will contain the metadata for your extension, such as its name, version, and permissions. Here's an example of what the `manifest.json` file might look like:
```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Takes a screenshot of the current webpage",
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "tabs",
    "<all_urls>"
  ]
}
```
3. Create a new file named `popup.html`. This file will contain the HTML for the extension's popup window. Here's an example of what the `popup.html` file might look like:
```html
<!DOCTYPE html>
<html>
  <head>
    <style>
      body {
        width: 200px;
        height: 200px;
      }
      button {
        width: 100%;
        height: 100%;
      }
    </style>
  </head>
  <body>
    <button id="screenshot-button">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>
```
4. Create a new file named `popup.js`. This file will contain the JavaScript for the extension's popup window. Here's an example of what the `popup.js` file might look like:
```javascript
document.getElementById('screenshot-button').addEventListener('click', function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(img) {
      var screenshotUrl = img;
      var viewTabUrl = tabs[0].url;
      chrome.tabs.create({url: screenshotUrl, active: true});
    });
  });
});
```
5. Create an icon for your extension and save it as `icon.png` in the same folder as the other files.

6. Open Chrome and navigate to `chrome://extensions/`.

7. Enable "Developer mode" by clicking the toggle switch in the top right corner.

8. Click the "Load unpacked" button and select the folder containing your extension files.

9. Your extension should now be installed and you can use it to take screenshots of webpages. To use the extension, simply click on its icon in the Chrome toolbar and then click the "Take Screenshot" button in the popup window.

