```javascript
function mergeArrays(arr1, arr2) {
  const mergedArray = [...arr1];

  arr2.forEach(obj2 => {
    const obj1 = mergedArray.find(
      obj1 => obj1.stepId === obj2.stepId && obj1.fieldId === obj2.fieldId
    );

    if (!obj1) {
      mergedArray.push(obj2);
    } else {
      obj1.message = obj1.message || obj2.message;
    }
  });

  return mergedArray;
}

