There are several ways a web application can communicate between two browser tabs:

1. LocalStorage and StorageEvent:
LocalStorage is a web storage object that stores data with no expiration date. When a value in the storage is changed, a 'storage' event is fired on all other windows/tabs that have access to the same storage. This can be used to communicate between tabs.

```javascript
// Tab 1
window.addEventListener('storage', function(event) {
  if (event.key === 'message') {
    console.log('Tab 1 received message:', event.newValue);
  }
});

// Tab 2
localStorage.setItem('message', 'Hello from Tab 2');
```

2. Cookies:
Cookies can also be used to communicate between tabs. When a cookie is set or updated, it is reflected in all tabs. However, this method is less efficient than using LocalStorage and StorageEvent.

3. BroadcastChannel API:
The BroadcastChannel API allows simple communication between browsing contexts (that is, windows, tabs, frames, or iframes) with the same origin. This can be used to send messages between tabs.

